const defaultState = {
  username: "null",
  password: "null"
}
export const reducer = (state = defaultState, action) => {

  if (action.type === 'init') {
    let newstate = JSON.parse(JSON.stringify(state))
    console.log(newstate)
    newstate.username = action.value.username

    return newstate
  }
  return state
}
